// src/api.js

export async function fetchProboEvents() {
    const url = 'https://prod.api.probo.in/api/v2/feed/public/homefeed';

    try {
      const response = await fetch(url, {
        headers: {
          'Content-Type': 'application/json',
          'x-device-os': 'DESKTOP',
          'x-version-name': '10',
          'appid': 'in.probo.pro'
        },
      });

      if (!response.ok) {
        throw new Error(`Network response not OK: ${response.status}`);
      }

      const data = await response.json(); 
      return data; 
    } catch (error) {
      console.error('Error fetching data:', error);
      return null;
    }
  }
